import React from 'react'
import { useState } from 'react'

function Dummy() {
   const [state, setState] = useState(0)
   const ha = () => {
      setState(state + 1)
   }

   console.log(state)
  return (
    <div >
      <button onClick={() => {ha()}}>click</button>
    </div>
  )
}

export default Dummy
